import Avatar from '../../assets/avatar.svg'
import React from 'react'

const Dashboard = () => {
    const contacts = [
        {
            name: 'Sarthak',
            status: 'Available',
            img: Avatar
        },
        {
            name: 'Aditi',
            status: 'Available',
            img: Avatar
        },
        {
            name: 'Harsh',
            status: 'Available',
            img: Avatar
        },
        {
            name: 'Dharya',
            status: 'Available',
            img: Avatar
        },
        {
            name: 'Aman',
            status: 'Available',
            img: Avatar
        },
        {
            name: 'Vismay',
            status: 'Available',
            img: Avatar
        },
    ]
  return (
    <div className='w-screen flex'>
    <div className='w-[25%] h-screen bg-secondary'>
        <div className='flex items-center my-5 mx-14'>
            <div className='border border-primary p-[2px] rounded-full'><img src={Avatar} width={75} height={75}/></div>
            <div className='ml-8'>
                <h3 className='text-2xl'>Talk-a-Tive</h3>
                <p className='text-lg font-light'>My Account</p>
            </div>
        </div>
        <hr/>
        <div className='mx-14 mt-5'>
            <div className='text-primary text-lg'>Messages</div>
            <div>
                {
                    contacts.map(({ name, status, img }) => {
                        return(
                            <div className='flex items-center py-5 border-b border-b-gray-300'>
                                <div className='cursor-pointer flex items-center'>
                                <div><img src={img} width={60} height={60}/></div>
                                <div className='ml-6'>
                                    <h3 className='text-base font-semibold'>{name}</h3>
                                    <p className='text-sm font-light text-gray-600'>{status}</p>
                                </div>
                                </div>
                            </div>
                        )
                    })
                }
            </div>
        </div>
    </div>
    <div className='w-[50%] h-screen'></div>
    <div className='w-[25%] h-screen'></div>
    </div>
  )
}

export default Dashboard
